import React from 'react';

import {FaBars} from 'react-icons/fa';

import styled from 'styled-components';

import {ProductConsumer} from '../context';

export default function Navbar() {

  return (

    <ProductConsumer>

      {value => {

        const {handleSidebar} = value;

        return (

          <NavWrapper>

            <div className = 'nav-center'>

              <FaBars className = 'nav-icon' onClick = {handleSidebar} />

              <img src = "https://pbs.twimg.com/profile_images/423747600978685953/iVkPSJqc.jpeg" alt = 'logo_vox' className = 'logo' width = "20%" height = "50px"/>

            </div>

          </NavWrapper>

        );

      }}

    </ProductConsumer>

  );

}

const NavWrapper = styled.nav`

  position: -webkit-sticky;

  position: sticky;

  top: 0;

  width: 100%;

  padding: 0.23rem 1.5rem;

  background: beige;

  border-bottom: 3px solid var(--primaryColor);

  z-index: 1;

  .nav-center {display: flex; align-items: center; justify-content: space-between; max-width: 1170px; margin: 0 auto;}

  .nav-icon {font-size: 1.5rem;cursor: pointer;}

  @media only screen and (max-width: 600px) { .logo {max-width: 200px;} }

`;
